import React, { useEffect, useState } from 'react';

function Form(){

    useEffect(()=>{
        fetch("http://localhost:5000", {
            method: "POST",
            headers: {
                'Content-type': 'text/html, charset=utf-8'
            }
        })
    });



    return (
        <div>
            <form action="http://localhost:5000/" method="post">
                <input type="text" name="test"/>
                <button>Test</button>
            </form>
        </div>
    )


}

export default Form;
